    render(){
        return(
        
            <Fragment>
               <MDBContainer>
               <MDBRow >
           <li>{this.props.details.name}</li>  <MDBIcon icon="times" />
                  </MDBRow>

                  <MDBRow >
                  </MDBRow>

               </MDBContainer>
        
          </Fragment>

     
        )
    }
};
 export default Coursrlist;
